CREATE TABLE IF NOT EXISTS public.messages
(
    id bigint NOT NULL GENERATED BY DEFAULT AS IDENTITY ( INCREMENT 1 START 1 MINVALUE 1 MAXVALUE 9223372036854775807 CACHE 1 ),
    telegram_sources_id bigint NOT NULL,
    date timestamp without time zone NOT NULL,
    message character varying(4096) COLLATE pg_catalog."default",
    sender_id bigint,
    message_id bigint NOT NULL,
    date_recognition timestamp without time zone,
    process_recognition integer,
    processing boolean NOT NULL DEFAULT false,
    CONSTRAINT messages_pkey PRIMARY KEY (id)
);

CREATE TABLE IF NOT EXISTS public.potential_telegram_sources
(
    id bigint NOT NULL GENERATED BY DEFAULT AS IDENTITY ( INCREMENT 1 START 1 MINVALUE 1 MAXVALUE 9223372036854775807 CACHE 1 ),
    parent_id bigint,
    link character varying COLLATE pg_catalog."default",
    is_processing boolean DEFAULT false,
    date_create_row timestamp without time zone NOT NULL DEFAULT '2024-04-04 00:00:00'::timestamp without time zone,
    date_formation_edge timestamp without time zone,
    CONSTRAINT potential_telegram_sources_pkey PRIMARY KEY (id)
);

CREATE TABLE IF NOT EXISTS public.sources_admins
(
    id integer NOT NULL GENERATED BY DEFAULT AS IDENTITY ( INCREMENT 1 START 1 MINVALUE 1 MAXVALUE 2147483647 CACHE 1 ),
    sources_id bigint NOT NULL,
    admins_id bigint NOT NULL,
    CONSTRAINT sources_admins_pkey PRIMARY KEY (id)
);

CREATE TABLE IF NOT EXISTS public.telegram_admins
(
    id integer NOT NULL GENERATED BY DEFAULT AS IDENTITY ( INCREMENT 1 START 1 MINVALUE 1 MAXVALUE 2147483647 CACHE 1 ),
    telegram_id bigint NOT NULL,
    nic character varying COLLATE pg_catalog."default",
    CONSTRAINT telegram_admins_pkey PRIMARY KEY (id)
);

CREATE TABLE IF NOT EXISTS public.telegram_sources
(
    id bigint NOT NULL GENERATED BY DEFAULT AS IDENTITY ( INCREMENT 1 START 1 MINVALUE 1 MAXVALUE 9223372036854775807 CACHE 1 ),
    telegram_id bigint NOT NULL,
    is_group boolean NOT NULL,
    is_channel boolean NOT NULL,
    participants_count integer,
    caption character varying(1024) COLLATE pg_catalog."default",
    link character varying(1024) COLLATE pg_catalog."default" NOT NULL,
    date_processing timestamp without time zone,
    username character varying(256) COLLATE pg_catalog."default",
    childs_count integer,
    CONSTRAINT telegram_sources_pkey PRIMARY KEY (id)
);

CREATE TABLE IF NOT EXISTS public.telegram_tree
(
    id bigint NOT NULL GENERATED BY DEFAULT AS IDENTITY ( INCREMENT 1 START 1 MINVALUE 1 MAXVALUE 9223372036854775807 CACHE 1 ),
    parent_id bigint NOT NULL,
    child_id bigint NOT NULL,
    date_formation_edge timestamp without time zone NOT NULL,
    date_create_row timestamp without time zone NOT NULL,
    CONSTRAINT telegram_tree_pkey PRIMARY KEY (id)
);

CREATE TABLE IF NOT EXISTS public.tg_accounts
(
    id smallint NOT NULL GENERATED ALWAYS AS IDENTITY ( INCREMENT 1 START 1 MINVALUE 1 MAXVALUE 32767 CACHE 1 ),
    api_id character varying COLLATE pg_catalog."default" NOT NULL,
    api_hash character varying COLLATE pg_catalog."default" NOT NULL,
    phone character varying COLLATE pg_catalog."default" NOT NULL,
    session_name character varying COLLATE pg_catalog."default" NOT NULL,
    password character varying COLLATE pg_catalog."default",
    is_initialized boolean NOT NULL DEFAULT false,
    date_start_used timestamp without time zone,
    date_end_used timestamp without time zone,
    CONSTRAINT tg_accounts_pkey PRIMARY KEY (id)
);






